window.bookSummaryJSON = "<p>There is Power and Authority in the Name of Jesus, God sent His Son to give us eternal life. God also sent His Son as an example of His Love for us. We can take the story of Jesus and learn from the miracles that He performed. <i>The Power of Praying the Miracles of Jesus</i> is a devotional study on each miracle that Jesus performed, followed by a prayer for the day. </p> <p>I pray that as each person reads this book God will ignite a deeper faith in each one of us, such that He is able to continue to perform miracles. </p>"; 
